import * as React from 'react';
import { Typography } from '@mui/material';

const NotificationPage = () => {
    return (
        <div>
            <Typography sx={{ fontSize: '2rem', color: '#185382', marginLeft: '1rem', marginTop: '2rem' }}>Notifications</Typography>
            <table style={{ width: '100%' }}>
                <tr style={{ backgroundColor: 'gray', height: '2.5rem' }}>
                    <th>No.</th>
                    <th>Posted Date</th>
                    <th>Posted By</th>
                    <th>Content</th>
                    <th>Deadline</th>
                    <th>Who Have Not Confirmed Yet</th>
                </tr>
            </table>
        </div>
    );
}
export default NotificationPage
